    align-items: center;
    width: 45vh; */

    display: flex;
    flex-direction: column;
    padding: 20px 10px;
    position: absolute;
    width: 259.91px;
    height: 260px;
    left: 18px;
    top: 610px;
    background: var(--grey0);
    border-radius: 0px 0px 5px 5px;
    justify-content: flex-end;
    align-items: flex-start;
    border: 1px solid var(--grey1);

`
